public void initFromReturnNoteJour(CustRORReturnNoteJour _custRORReturnNoteJour)
{
    this.SalesId                = _custRORReturnNoteJour.SalesId;
    this.ReturnNoteId           = _custRORReturnNoteJour.ReturnNoteId;
    this.DeliveryDate           = _custRORReturnNoteJour.DeliveryDate;
    this.NumberSequenceGroup    = _custRORReturnNoteJour.NumberSequenceGroup;
}

public void initFromSalesLine(SalesLine _salesLine)
{
    SalesTable salesTable;

    this.OrigSalesId                    = _salesLine.SalesId;
    this.InventTransId                  = _salesLine.InventTransId;
    this.InventDimId                    = _salesLine.InventDimId;
    this.ItemId                         = _salesLine.ItemId;
    this.SalesCategory                  = _salesLine.SalesCategory;
    this.StockedProduct                 = _salesLine.StockedProduct;
    this.LineNum                        = _salesLine.LineNum;
    this.ExternalItemId                 = _salesLine.ExternalItemId;
    this.PriceUnit                      = _salesLine.PriceUnit;
    this.Name                           = _salesLine.Name;
    this.SalesUnit                      = _salesLine.SalesUnit;
    this.Qty                            = _salesLine.SalesDeliverNow;
    this.SalesGroup                     = _salesLine.SalesGroup;
    this.DefaultDimension               = this.copyDimension(_salesLine.DefaultDimension);
    this.TransactionCode                = _salesLine.TransactionCode;
    this.DeliveryDate                   = _salesLine.deliveryDate();
    this.Transport                      = _salesLine.Transport;
    this.Port                           = _salesLine.Port;
    this.StatProcId                     = _salesLine.StatProcId;
    this.LineHeader                     = _salesLine.LineHeader;
    this.DeliveryType                   = _salesLine.DeliveryType;
    this.TradeType                      = _salesLine.RORTradeType;

    this.InterCompanyInventTransId      = _salesLine.InterCompanyInventTransId;

    this.InventRefType                  = _salesLine.InventRefType;
    this.InventRefId                    = _salesLine.InventRefId;
    this.InventRefTransId               = _salesLine.InventRefTransId;

    this.SalesLineShippingDateConfirmed = _salesLine.ShippingDateConfirmed;
    this.SalesLineShippingDateRequested = _salesLine.ShippingDateRequested;

    this.Ordered                        = _salesLine.SalesQty - _salesLine.deliveredInTotal();
    this.Ordered                        = sign(_salesLine.SalesQty) < 0 ? min(0.0, this.Ordered) : max(0.0, this.Ordered);

    if(isConfigurationkeyEnabled(configurationKeyNum(TradeMultiShipTo)))
    {
        this.DeliveryPostalAddress      = _salesLine.DeliveryPostalAddress;
    }
    else
    {
        salesTable = _salesLine.salesTable();
        this.DeliveryPostalAddress      = salesTable.DeliveryPostalAddress;
    }
}

