public Common interCompanySourceTable(boolean interCompanySource = true)
{
    if (interCompanySource)
    {
        return PurchLine::findInventTransId(this.InterCompanyInventTransId).purchTable();
    }
    else
    {
        return PurchLine::findInventTransId(this.InventRefTransId).purchTable();
    }
}

server display SalesCostValue inventCostAmount()
{
    InventTransOriginId inventTransOriginId = InventTransOrigin::findByInventTransId(this.InventTransId).RecId;

    return InventTransPackingSlip::costAmount(inventTransOriginId, this.ReturnNoteId, this.DeliveryDate);
}

/// <summary>
///    Calculates the physical cost price from the current return note transaction record.
/// </summary>
/// <returns>
///    The physical cost price.
/// </returns>
server SalesCostValue inventCostAmountPhysical()
{
    InventTransOriginId inventTransOriginId = InventTransOrigin::findByInventTransId(this.InventTransId).RecId;

    return InventTransPackingSlip::costAmountPhysical(inventTransOriginId, this.ReturnNoteId, this.DeliveryDate);
}

public InventDim inventDim(boolean  update = false)
