public DimensionDefault mergeDimension(
    DimensionDefault _primaryDefaultDimension,
    DimensionDefault _secondaryDefaultDimension = 0,
    DimensionMerge   _dimensionMerge = DimensionMerge::newFromTable(this, CompanyInfo::findDataArea(this.DataAreaId).RecId)
    )
{
    return _dimensionMerge.merge(_primaryDefaultDimension, _secondaryDefaultDimension);
}

display server InventQty remainInventFinancial()
{
    InventQty           invoicedQty;

    invoicedQty = CustInvoicePackingSlipQuantityMatch::inventoryQuantityMatched(this.SourceDocumentLine);
    return this.InventQty - invoicedQty;
}

display server SalesQty remainSalesFinancial()
{
    SalesQty        invoicedQty = CustInvoicePackingSlipQuantityMatch::salesQuantityMatched(this.SourceDocumentLine);

    return this.Qty - invoicedQty;
}

public SalesLine salesLine(boolean _update = false)
{
    return SalesLine::findInventTransId(this.InventTransId, _update);
}

display UnitOfMeasureReportingText salesUnitTxt()
{
    CustRORReturnNoteJour custRORReturnNoteJour = this.custRORReturnNoteJour();

    if (custRORReturnNoteJour)
    {
        return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
            UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
            custRORReturnNoteJour.LanguageId);
    }

    if (this.SalesId)
    {
        return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
            UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
            SalesTable::find(this.SalesId).LanguageId);
    }

    return UnitOfMeasureReportingTranslation::unitOfMeasureReportingText(
        UnitOfMeasure::unitOfMeasureIdBySymbol(this.SalesUnit),
        CompanyInfo::languageId());
}

public void setLineNum(LineNum lineNum)
{
    this.LineNum = lineNum;
}

public static CustRORReturnNoteTrans findRecId(
    RecId       _recId,
    boolean     _forUpdate = false )
{
    CustRORReturnNoteTrans custRORReturnNoteTrans;

    custRORReturnNoteTrans.selectForUpdate(_forUpdate);

    select custRORReturnNoteTrans
    where custRORReturnNoteTrans.RecId == _recId;

    return custRORReturnNoteTrans;
}
